    public static final String[] LANGUAGES_ORIGINAL_ISO;
    public static final String[] LANGUAGES_ORIGINAL;
    static {
        String[][] lngs = getLngORIGINAL();
        LANGUAGES_ORIGINAL_ISO = new String[lngs.length];
        LANGUAGES_ORIGINAL = new String[lngs.length];
        int i = 0;
        for (String[] lng : lngs) {
            LANGUAGES_ORIGINAL_ISO[i] = lng[0];
            LANGUAGES_ORIGINAL[i] = lng[1];
            i++;
        }
    }

    public static final String[] KEYS_ZH;
    static {
        Set<String> keys = new HashSet<String>(LANGUAGES_ZH_ISO.length);
        for (String k : LANGUAGES_ZH_ISO) {
            keys.add(k);
        }
        KEYS_ZH = keys.toArray(new String[keys.size()]);
        java.util.Arrays.sort(KEYS_ZH);
    }

